import React from 'react'
import AvatarImg from '../../'

class Icon extends React.Component{

    render(){
        return (
            <div style={{display:"inline", position:"relative", left:"20px"}}>
                <img src="src/images/person-male.png" style={{ width:"50px", float:"right"}}/>
            </div>
        )
    }

}

export default Icon
